import react from 'react';
import { useSelector } from 'react-redux';

function Cart(){


  let a = useSelector((state)=>{return state})
  console.log(a)

  return (
    <div className='Cart'>
      <table>
        <thead>
          <tr>
            <th>상품</th>
            <th>갯수</th>
            <th>변경</th>
            <th>가격</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>스마일케이크</td>
            <td>1개</td>
            <td>쁠/마/삭제</td>

          </tr>
        </tbody>
      </table>
      <div className='orderArea'>
        <button className='orderBtn2'>주문하기</button>
      </div>
    </div>
  );
};
export default Cart;
